import React from "react";
import { useParams } from "react-router-dom";


const Detail = (props) => {
    let urlId = useParams();
    const filteredSool = props.sool.filter((el) => el.id === urlId.id)

    return (
        <div>
            <div>안녕하세요 detail 술 아이디는 {filteredSool[0].id}</div>
        </div>
    )
}

export default Detail
